import React, { useState } from "react";
import styled from "styled-components";
import PicAdd from "../UI_components/PicAdd";
import { dummyData } from "../data/dummyData";

const Add = () => {
  const [picData, setPicData] = useState(dummyData);
  const Add_container = styled.div`
    width: 390px;
    height: 100%;
    display: flex;
    flex-direction: column;
  `;
  const Info_container = styled.section`
    height: 76px;
    background-color: #f4eee2;
    margin-bottom: 20px;
  `;
  const Picadd_wrapper = styled.section``;

  return (
    <>
      <Add_container>
        <Info_container></Info_container>
        <Picadd_wrapper>
          {picData.map((el) => {
            return (
              <PicAdd
                key={picData.id}
                picture={el.picture}
                content={el.picture}
              ></PicAdd>
            );
          })}
        </Picadd_wrapper>
      </Add_container>
    </>
  );
};

export default Add;
